window.addEventListener('DOMContentLoaded', () => {
  const canvas_gratte = document.getElementById('canvas_gratte')
  const scalpel_lo = document.getElementById('scalpel')
  const main = document.getElementById('main')

  const ctx_am = canvas_gratte.getContext('2d', { willReadFrequently: true })
  const rect_am = canvas_gratte.getBoundingClientRect()

  let taille_trait_am = 70

  canvas_gratte.width = rect_am.width
  canvas_gratte.height = rect_am.height

  let drawing_am = false
  let lastX_am = 0
  let lastY_am = 0

  function getCoords(e) {
    const r_am = canvas_gratte.getBoundingClientRect()
    const cx_am = (e.clientX ?? e.touches[0].clientX) - r_am.left
    const cy_am = (e.clientY ?? e.touches[0].clientY) - r_am.top
    return {
      x: cx_am,
      y: cy_am,
    }
  }

  let x, y

  grattoire()

  function grattoire() {
    canvas_gratte.addEventListener('touchstart', clickANDTouch)

    canvas_gratte.addEventListener('mousedown', clickANDTouch)

    canvas_gratte.addEventListener('touchmove', move)
    canvas_gratte.addEventListener('mousemove', move)

    canvas_gratte.addEventListener('touchend', lache)
    canvas_gratte.addEventListener('mouseup', lache)

    const img_gratte = new Image()
    img_gratte.crossOrigin = 'anonymous'
    img_gratte.src =
      'data:image/png;base64,'

    img_gratte.onload = function () {
      ctx_am.drawImage(
        img_gratte,
        0,
        0,
        canvas_gratte.width,
        canvas_gratte.height
      )
    }
  }

  function clickANDTouch(e) {
    // scalpel_lo.style.top = (`${e.clientY + 150}px`?? `${e.clientY + 150}px`);
    //     scalpel_lo.style.left = (`${e.clientX - 50}px` ?? `${e.clientX - 50}px`);

    let clientX, clientY

    if (e.touches && e.touches.length > 0) {
      clientX = e.touches[0].clientX
      clientY = e.touches[0].clientY
    } else {
      clientX = e.clientX
      clientY = e.clientY
    }

    scalpel_lo.style.top = `${clientY + 150}px`
    scalpel_lo.style.left = `${clientX - 50}px`
    scalpel_lo.style.transform = `rotate(45deg)`
    scalpel_lo.style.transition = `transform 0.1s ease-in-out`

    drawing_am = true
    const { x, y } = getCoords(e)

    lastX_am = x
    lastY_am = y
  }

  function move(e) {
    let clientX, clientY
    if (e.touches && e.touches.length > 0) {
      // SI on est en touch
      clientX = e.touches[0].clientX
      clientY = e.touches[0].clientY
    } else {
      clientX = e.clientX
      clientY = e.clientY
    }

    scalpel_lo.style.top = `${clientY + 150}px`
    scalpel_lo.style.left = `${clientX - 50}px`
    scalpel_lo.style.transform = `rotate(45deg)`

    drawing_am = true
    const { x, y } = getCoords(e)

    lastX_am = x
    lastY_am = y
  }

  function move(e) {
    let clientX, clientY
    if (e.touches && e.touches.length > 0) {
      // SI on est en touch
      clientX = e.touches[0].clientX
      clientY = e.touches[0].clientY
    } else {
      clientX = e.clientX
      clientY = e.clientY
    }

    scalpel_lo.style.top = `${clientY + 140}px`
    scalpel_lo.style.left = `${clientX - 50}px`
    scalpel_lo.style.transform = `rotate(45deg)`

    if (!drawing_am) return

    if (!drawing_am) return

    const { x, y } = getCoords(e)
    ctx_am.lineWidth = taille_trait_am
    ctx_am.globalCompositeOperation = 'destination-out'
    ctx_am.beginPath()
    ctx_am.moveTo(lastX_am, lastY_am)
    ctx_am.lineTo(x, y)
    ctx_am.stroke()
    ctx_am.lineCap = 'round'
    lastX_am = x
    lastY_am = y

    handlePercentage(getFilledInPixels(32))

    setTimeout(() => {
      main.remove()
    })
  }

  function lache(e) {
    // scalpel_lo.style.transform = `rotate(90deg)`;
    // scalpel_lo.style.transition = `transform 0.3s ease-in-out`;
    // scalpel_lo.style.top = `600px`;
    // scalpel_lo.style.left = `1320px`;

    drawing_am = false
  }

  function getFilledInPixels(stride) {
    if (!stride || stride < 1) {
      stride = 1
    }

    var pixels = ctx_am.getImageData(
      0,
      0,
      canvas_gratte.width,
      canvas_gratte.height
    )
    pdata = pixels.data
    l = pdata.length
    total = l / stride
    count = 0

    for (var i = (count = 0); i < l; i += stride) {
      if (parseInt(pdata[i]) === 0) {
        count++
      }
    }

    return Math.round((count / total) * 100)
  }

  function handlePercentage(filledInPixels) {
    filledInPixels = filledInPixels || 0

    if (filledInPixels > 80) {
      canvas_gratte.style.pointerEvents = 'none'

      ctx_am.clearRect(0, 0, canvas_gratte.width, canvas_gratte.height)

      setTimeout(() => {
        const livre_am = document.getElementById('livre_am')
        livre_am.style.transition = 'transform 0.5s ease-out'
        livre_am.style.transform = 'scale(1.3)'
        const finished_lo = document.querySelector('.finished_lo')
        finished_lo.style.display = 'flex'

        scalpel_lo.style.transform = `rotate(90deg)`
        scalpel_lo.style.transition = `transform 0.3s ease-in-out`
        scalpel_lo.style.top = `600px`
        scalpel_lo.style.left = `1320px`

        pe_selection_modal()
        //pe_apparraitre_modal("container_pe_button_modal");
        //document.querySelector('#container_pe_button_modal').classList.add('active_zoom');
        const modal_ape = document.getElementById('container_pe_button_modal')
        console.log('modal element:', modal_ape)
        modal_ape.style.display = 'flex'
        modal_ape.style.gap = '80px 30px'
      }, 500)

      setTimeout(() => {
        scalpel_lo.style.transition = 'opacity 0.5s ease-out'
        scalpel_lo.style.opacity = '0'
      }, 2000)
    }
  }

const display_modale = (event) => {
        const modals = document.querySelectorAll('.img_gratte_invisible')

        // on recupere l'id d'une eventuelle modal active
        const currentModalActive = document.querySelector(
          '.img_gratte_invisible.active_zoom'
        )
        const currentModalActiveId =
          currentModalActive?.id.split('pe_modal_grand_')[1]

        // on recupere l'id du circle qui vient d'entre click
        const clickedCirle = event.target.closest('.pe_cercle_invisible')
        const clickedCircleId = clickedCirle?.id.split(
          'pe_cercle_invisible_'
        )[1]

        if (currentModalActiveId === clickedCircleId) {
          // si on clique sur un cercle deja active
          currentModalActive.classList.remove('active_zoom')
        } else {
          Array.from(modals).forEach((modal) => {
            modal.classList.remove('active_zoom')
          })

          // on ajoute la classe active sur la modal dont l'id est reli  celui du cercle cliqu
          const clickedCircleModal = document.getElementById(
            `pe_modal_grand_${clickedCircleId}`
          )
          clickedCircleModal.classList.add('active_zoom')
        }
      }


  function pe_selection_modal() {
    const pe_cercles = document.querySelectorAll('.pe_cercle_invisible')
    const img_gratte_invisible = document.querySelectorAll(
      '.img_gratte_invisible'
    )
    console.log('cercles trouvs :', pe_cercles.length)
    console.log('images trouves :', img_gratte_invisible.length)

    pe_cercles.forEach((cercle, i) => {
      cercle.addEventListener('touchstart', display_modale)
    })

    const modal_backdrop_1 = document.getElementById(
      'pe_modal_grand_backdrop_1'
    )
    const modal_backdrop_2 = document.getElementById(
      'pe_modal_grand_backdrop_2'
    )
    const modal_backdrop_3 = document.getElementById(
      'pe_modal_grand_backdrop_3'
    )
    const modal_backdrop_4 = document.getElementById(
      'pe_modal_grand_backdrop_4'
    )

    modal_backdrop_1.addEventListener('touchstart', (event) => {
      // desactiv toutes les classes active_zoom des modals
      img_gratte_invisible.forEach((modal) => {
        modal.classList.remove('active_zoom')
      })
    })
    modal_backdrop_2.addEventListener('touchstart', (event) => {
      img_gratte_invisible.forEach((modal) => {
        modal.classList.remove('active_zoom')
      })
    })
    modal_backdrop_3.addEventListener('touchstart', (event) => {
      img_gratte_invisible.forEach((modal) => {
        modal.classList.remove('active_zoom')
      })
    })
    modal_backdrop_4.addEventListener('touchstart', (event) => {
      img_gratte_invisible.forEach((modal) => {
        modal.classList.remove('active_zoom')
      })
    })
  }
})
